		}

		h3,
		h4,
		h5,
		h6 {
			margin: 0 0 2.4rem;
		}

		p {
			margin: 0;
			padding: 0;
			color: #ccc;
		}

			max-width: 64rem;

			display: flex;
			flex-direction: column;

			height: 5.6rem;

		}

		.logo svg {
			height: 100%;
			fill: currentColor;
		}
	</style>
